import styled from "styled-components";


export const Wrapper = styled.div `
    position: relative;
    min-height: 100vh;
    width: 100vw;
    height: 100vh;
    background: blue;

`

export const Content = styled.div `

 {
    min-height: 100vh;

    padding-bottom: 8em;    /* Footer height */
  }

`
